import React from 'react';
import Navbar from '../../components/Nav/Nav';
import './home.css';

const HomePage = () => {
  const scrollToNextPage = () => {
    window.scrollTo({
      top: window.innerHeight,
      behavior: 'smooth'
    });
  };

  return (
    <div className='homepage'>
      <Navbar />
      <div className='homepage'>
        <h1 className='title'>Pr00f 0f W0rk</h1>
      </div>
    </div>
  );
};

export default HomePage;
